window.bookSummaryJSON = "<p>Named as one of the best romances of 2016 by Amazon. </p> <p>With nothing but rumors to lead her, Lynne Harmony has trekked across a nightmare landscape to find one man; a mysterious, damaged legend who protects the weak and leads the strong. He's more than muscle and firepower - and in post-plague LA, he's her only hope. </p> <p>As the one woman who could cure the disease, Lynne is the single most volatile - and vulnerable - creature in this new and ruthless world. But face to face with Jax Mercury...danger has never looked quite so delicious. </p>"; 
